"use strict";(self.webpackChunkauthApp=self.webpackChunkauthApp||[]).push([[605],{9605:e=>{e.exports=JSON.parse('[{"key":"0","label":"Sobre nosotros","children":[{"key":"0-0","label":"\xbfCu\xe1nto tiempo lleva la empresa?","data":"/faqs","txt":{"es":"Tenemos varios emprendimientos de comercio electr\xf3nico, siempre estamos innovando y nuestro equipo tiene mucha experiencia en este nuevo mundo del comercio. No dudes en confiar en nuestras manos para seleccionar tus nuevas zapatillas."},"type":"url"},{"key":"0-1","label":"\xbfD\xf3nde se encuentran?","data":"/faqs","txt":{"es":"Nuestra empresa est\xe1 registrada en Espa\xf1a, pero solo a t\xedtulo administrativo. Nuestro mercado es el mundo y no creemos en las fronteras como l\xedmite al comercio."},"type":"url"}]},{"key":"1","label":"Sobre los precios","children":[{"key":"1-0","label":"\xbfPor qu\xe9 los precios tan bajos?","data":"/faqs","txt":{"es":"<p>Creemos y trabajamos para en generar muchas ventas. Eso nos permite reducir nuestros m\xe1rgenes de beneficio. Otras empresas optan por triplicar los precios de coste. Preferimos crear comunidad. Gracias a que disponemos de precios directos de f\xe1brica podemos reducirlos significativamente en comparaci\xf3n con la realidad de otros vendedores</p>"},"type":"url"}]},{"key":"2","label":"Acerca de los env\xedos","children":[{"key":"2-0","label":"\xbfC\xf3mo es el proceso de env\xedo?","data":"/faqs","txt":{"es":"<p>1- Se realiza el pago. <br>2- Se procesa el pago. <br>3- Se procesa y env\xeda el pedido. (24 / 48hs) En casos muy concretos este tiempo puede ser un poco m\xe1s largo, llegando hasta las 72hs. <br>4- El pedido llega a tu domicilio. (El tiempo de entrega depende del env\xedo seleccionado). Algunos pa\xedses (fuera de los EE. UU., Canad\xe1, la Comunidad Europea) pueden tener retrasos espec\xedficos en relaci\xf3n con su sistema de correo nacional.</p>"},"type":"url"},{"key":"2-1","label":"\xbfQu\xe9 tipos de env\xedos realizan?","data":"/faqs","txt":{"es":"<p>Trabajamos con dos tipos de env\xedos:<br> 1- ENV\xcdO EXPRESS - Este env\xedo tiene un costo adicional y demora entre 15 a 20 d\xedas h\xe1biles desde que se proces\xf3 el pedido.<br>2- ENV\xcdO GRATIS * - Este env\xedo solo est\xe1 disponible en compras superiores a \u20ac99,99<br>* no disponible para algunos pa\xedses - para m\xe1s informaci\xf3n consultar a trav\xe9s del formulario de contacto</p>"},"type":"url"},{"key":"2-2","label":"\xbfEnv\xedan contra reembolso?","data":"/faqs","txt":{"es":"<p>Al tratarse de env\xedos internacionales, es muy dif\xedcil contar con este tipo de servicio. Por este motivo hemos decidido no disponer de esta modalidad</p>"},"type":"url"},{"key":"2-3","label":"\xbfQu\xe9 pasa si no estoy en casa el d\xeda de la entrega?","data":"/faqs","txt":{"es":"<p>En este caso, el repartidor dejar\xe1 un aviso * con el que deber\xe1 dirigirse a la oficina de correos junto con su identificaci\xf3n personal. En cualquier caso, un familiar que se encuentre en ese momento tambi\xe9n podr\xeda vivirlo. <br> Tenga en cuenta que no pueden pasar m\xe1s de 15 d\xedas desde la visita del repartidor, ya que si eso sucede la oficina de correos devolver\xe1 el paquete al remitente. En caso de que esto suceda tendr\xe1s que volver a pagar el env\xedo para que podamos envi\xe1rselo de nuevo una vez que lo recibamos. <br> * Puede haber diferencias en la gesti\xf3n seg\xfan el pa\xeds de destino.</p>"},"type":"url"},{"key":"2-4","label":"\xbfQu\xe9 puedo hacer si no recibo mi pedido?","data":"/faqs","txt":{"es":"<div><p>Partiendo de la base que realizamos env\xedos internacionales, aunque no es habitual, estos eventualmente podr\xedan perderse o tener alg\xfan problema que impida su ubicaci\xf3n. Por este motivo disponemos de un seguro de reembolso.</p><p>Para solicitar el reembolso deben haber transcurrido 60 d\xedas h\xe1biles desde la fecha de env\xedo y debe solicitarlo por correo electr\xf3nico especificando la referencia del pedido a nuestro correo electr\xf3nico de soporte hola@nowsneakers.com. </p><p>Para solicitar el reembolso deben haber transcurrido 60 d\xedas h\xe1biles desde la fecha de env\xedo y debe solicitarlo por correo electr\xf3nico especificando la referencia del pedido a nuestro correo electr\xf3nico de soporte hola@nowsneakers.com.</p><p>Una vez solicitado el reembolso del pedido, nuestro equipo evaluar\xe1 su caso y comunicar\xe1 una resoluci\xf3n en un plazo de 72 horas. Si se aprueba su solicitud, se devolver\xe1 el importe total , si es posible por el mismo m\xe9todo de pago que realiz\xf3 la compra</p></div>"},"type":"url"}]},{"key":"3","label":"Sobre los pagos","children":[{"key":"3-0","label":"\xbfQu\xe9 m\xe9todos de pago est\xe1n disponibles?","data":"/faqs","txt":{"es":"<div><p>Los pagos actualmente disponibles los puedes ver <a href=\'/way-to-pay\'>aqu\xed</a>.</p></div>"},"type":"url"},{"key":"3-1","label":"\xbfSeguridad SSL?","data":"/faqs","txt":{"es":"<div><p>Un certificado SSL (Secure Sockets Layer) es un t\xedtulo digital que autentica la identidad de un sitio web y cifra la informaci\xf3n enviada al servidor con tecnolog\xeda SSL. ... Un certificado sirve como un \'pasaporte\' electr\xf3nico que establece las credenciales de una entidad en l\xednea al hacer negocios en la Web.</p><p>En otras palabras, esto asegura que nadie pueda ver la informaci\xf3n entre las comunicaciones entre el cliente y el servidor, lo que hace imposible que alguien vea datos esenciales como n\xfameros de tarjetas de cr\xe9dito, ID, contrase\xf1as y otros personales.</p></div>"},"type":"url"}]}]')}}]);